css:
.build h1.error {
  color: white;
  background-image: none;
  background-color: #cc0000;
}
.build h1.success {
  color: white;
  background-image: none;
  background-color: #17ca65;
}
.build h1.warning {
  color: white;
  background-image: none;
  background-color: #ffaa2c;
}
.build ol {
  transition: height 0.5s ease-in-out;
  padding: 10px 0 0 10px;
  min-height: 100px;
  overflow-y: auto;
}
.build li {
  word-wrap: break-word;
  white-space: pre-wrap;
  list-style: none;
  font-family: monospace;
}
.build li.error {
  animation: none;
  -webkit-animation: none;
  color: #cc0000;
}
.btn-container .btn {
  float: right;
  margin: 10px 10px 0 0;
}
.btn-container .btn:focus,
.btn-container .btn:active,
.btn-container .btn:hover {
  color: #fff;
}
.btn-container .icon::before {
  margin: 0;
}
.btn-container .new-row {
  clear: both;
}
